import React,{Component} from "react";
class NewFilm extends Component{
 render() {
    class newfilm {
        constructor(name, image) {
          this.name = name;
          this.image = image;
        }
      }
      var film1= newfilm("film 1","cuteCat.jpg" )
        return (
            <div className="NewFilm row">
                <div className="col-md-2">
                <img src="./image/cuteCat.jpg" alt="Ảnh minh họa" />
                <h3 className="nameFilm">Film 1</h3>
                </div>

                <div className="col-md-2">
                <img src="./image/kong.jpg" alt="Ảnh minh họa" />
                <h3 className="nameFilm">Film 2</h3>
                </div>

                <div className="col-md-2">
                <img src="./image/cuteCat.jpg" alt="Ảnh minh họa" />
                <h3 className="nameFilm">Film 3</h3>

                </div>

                <div className="col-md-2">
                <img src="./image/cuteCat.jpg" alt="Ảnh minh họa" />
                <h3 className="nameFilm">Film 4</h3>
                </div>

                <div className="col-md-2">
                <img src="./image/cuteCat.jpg" alt="Ảnh minh họa" />
                <h3 className="nameFilm">Film 5</h3>
                </div>

                <div className="col-md-2">
                <img src="./image/cuteCat.jpg" alt="Ảnh minh họa" />
                <h3 className="nameFilm">Film 6hhhhhhhhhhhhhhhhhhhhhhhhhhhhhffffffffffffffffffffffffff</h3>
                </div>
                <div class="fb-page">
<iframe src="https://www.facebook.com/plugins/page.php?href=https%3A%2F%2Fwww.facebook.com%2FIsokids-102914425225086%2F&tabs&width=340&height=130&small_header=false&adapt_container_width=true&hide_cover=false&show_facepile=true&appId" width={340} height={130} style={{border: 'none', overflow: 'hidden'}} scrolling="no" frameBorder={0} allowFullScreen="true" allow="autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share" />
                </div>
            </div>
           
        )
 }
}
export default NewFilm;
